import React from "react";
import { Link } from "react-router-dom";

import {
  AppBar,
  Toolbar,
  Typography,
  Grid,
  Paper,
  Button
} from "@material-ui/core";
import TodoApp from "../components/TodoApp";

function Home() {
  return (
    <div>
      <AppBar
        color="secondary"
        position="static"
        style={{ height: "10vh", justify: "space-around" }}
      >
        <Toolbar>
          <Typography variant="h6" color="inherit">
            Welcome to your Todo List
          </Typography>
          <Button component={Link} to={"/today"} variant="h6">
            Today
          </Button>
          <Button component={Link} to={"/seven"}>
            <Typography variant="h2">Next Seven days</Typography>
          </Button>
          <Button component={Link} to={"/important"}>
            Important
          </Button>
        </Toolbar>
      </AppBar>

      <Grid container justify="center" style={{ marginTop: "2rem" }}>
        <Grid item xs={12} md={8} lg={4}>
          <TodoApp />
        </Grid>
      </Grid>
    </div>
  );
}

export default Home;
